Jim Rhodes is een ruige agent van de grenspolitie. Wanneer zijn tienerdochter ontvoerd wordt, wordt hij gedwongen een groep 
genadeloze moordenaars de wildernis in te leiden om hun verloren deel van een mislukte deal terug te halen. Om zijn dochter te 
redden zal Jim nu zijn survival-technieken moeten gebruiken om de ontvoerders te slim af te zijn.
